--
-- Table structure for table `ordermaster`
--

DROP TABLE IF EXISTS `ordermaster`;
CREATE TABLE IF NOT EXISTS `ordermaster` (
  `OmId` int(11) NOT NULL AUTO_INCREMENT,
  `OmCompanyCode` varchar(6) NOT NULL DEFAULT '001',
  `OmCompanyName` varchar(150) NOT NULL,
  `OmCreatedOn` date DEFAULT NULL,
  `OmLpo` varchar(100) DEFAULT NULL,
  `OmPayTime` enum('Cash','30 Days','60 Days','90 Days','120 Days') NOT NULL,
  `OmStatus` tinyint(1) NOT NULL DEFAULT '0',
  `OmStore1` tinyint(4) NOT NULL DEFAULT '0',
  `OmStore2` tinyint(4) NOT NULL DEFAULT '0',
  `OmPrinted` tinyint(4) NOT NULL DEFAULT '0',
  `OmCreatedBy` int(11) NOT NULL DEFAULT '1',
  `OmIsDeleted` tinyint(1) NOT NULL DEFAULT '0',
  `OmDiscount` decimal(10,2) NOT NULL DEFAULT '0.00',
  `OmModifiedOn` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `OmModifiedBy` int(11) DEFAULT NULL,
  `OmIsModifying` tinyint(1) NOT NULL DEFAULT '0',
  `OmAdd` varchar(200) DEFAULT NULL,
  `OmTel1` varchar(50) DEFAULT NULL,
  `OmTel2` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`OmId`),
  KEY `FkeyUser` (`OmCreatedBy`),
  KEY `FkeyCustCode` (`OmCompanyCode`)
) ENGINE=InnoDB AUTO_INCREMENT=156 DEFAULT CHARSET=utf8;

